import Nav from 'react-bootstrap/Nav';

function Menu() {
    return (
            <Nav className="justify-content-center bg-light" activeKey="/home">
                <Nav.Item>
                    <Nav.Link href="/" className="text-dark">Home</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link href="/about" className="text-dark">About</Nav.Link>
                </Nav.Item>
            </Nav>
    );
}

export default Menu;
